import styled from "styled-components";

const Section = {
    backgroundColor: 'pink',
    padding: "70px 20px",
}

const Row = {
    display: "flex",
    justifyContent: "center"
}   

const Image = {
    height: "350px",
    width: "500px",
    backgroundColor: "lightgray",
    margin: "20px"
}

const Copy = {
    maxWidth: "600px",
    margin: "20px",
    display: "flex",
    flexDirection: "column",
    justifyContent: "center"
}

class CareersCopy extends Component {
    render() {
        return (
            <div style={Section}>
                <div style={Row}>
                    <div style={Image}></div>
                    <div style={Copy}>
                        <h3 style={{margin: "0 0 15px 0"}}>Our Culture</h3>
                        <p style={{margin: "0"}}>Weâ€™ve taken a huge challenge and made it into our mission: To create an open financial system for the world. To achieve this, we are building a team of smart, creative, passionate optimists, the kind of people who see opportunity where others see roadblocks. If this sounds like you, check out our open roles.</p>
                    </div>
                </div>
            </div>
        );
    }
}
export default CareersCopy;
